INSERT INTO `cms_article` VALUES (12,'修改',1,'2020-03-05 16:10:10',1,'2020-03-12 13:11:17',1,'<h2>The three greatest things you learn from traveling</h2><p>Like all the great things on earth traveling teaches us by example. Here are some of the most precious lessons I’ve learned over the years of traveling.</p><h3>Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it’s also nice to learn about cultures online or from books, nothing comes close to experiencing <a href=\"https://en.wikipedia.org/wiki/Cultural_diversity\">cultural diversity</a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be quite terrifying. While change and uncertainty makes us scared, traveling teaches us how ridiculous it is to be afraid of something before it happens. The moment you face your fear and see there was nothing to be afraid of, is the moment you discover bliss.</p>',NULL,0,'','ThethreegreatestthingsyoulearnfromtravelingLikeallthegreatthingsonearthtravelingteachesusbyexample.HerearesomeofthemostpreciouslessonsI’velearnedovertheyearsoft',0,0,'那边v你','','1583395792194'),(13,'jkllllllllllllljkl',1,'2020-03-12 12:54:31',1,'2020-03-12 13:08:32',4,'<h2>The three greatest things you learn from traveling</h2><p>Like all the great things on earth traveling teaches us by example. Here are some of the most precious lessons I’ve learned over the years of traveling.</p><h3>Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it’s also nice to learn about cultures online or from books, nothing comes close to experiencing <a href=\"https://en.wikipedia.org/wiki/Cultural_diversity\">cultural diversity</a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be qu