',1,'2020-05-13 11:05:54',NULL,NULL,2,'<h2>The three greatest things you learn from traveling</h2><p>Like all the great things on earth traveling teaches us by\r\nexample. Here are some of the most precious lessons I&rsquo;ve learned\r\nover the years of traveling.</p><h3>Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it&rsquo;s also nice to learn about cultures online or from books, nothing comes close to experiencing <a href=\"https://en.wikipedia.org/wiki/Cultural_diversity\">cultural\r\ndiversity</a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be quite terrifying. While change\r\nand uncertainty makes us scared, traveling teaches us how\r\nridiculous it is to be afraid of something before it happens.\r\nThe moment you face your fear and see there was nothing to be\r\nafraid of, is the moment you discover bliss.</p>',NULL,0,'','ThethreegreatestthingsyoulearnfromtravelingLikeallthegreatthingsonearthtravelingteachesusby\r\nexample.HerearesomeofthemostpreciouslessonsI&rsquo;velearned\r\noverthe',2,1,'dfgfdgdfgfdgdfgfggf','','1589339133779'),(93,'洗衣机槽清洗剂泡腾片家用滚筒式泡腾清洁片杀菌消毒污渍除垢神器k\'k\'k',NULL,'2020-05-14 01:29:10',NULL,NULL,6,NULL,NULL,0,NULL,NULL,2,0,NULL,NULL,NULL),(94,'纱芊10包原色抽纸家用实惠装纸巾面巾纸餐巾纸卫生纸抽整箱批发酷酷酷',NULL,'2020-05-14 01:29:10',NULL,NULL,6,NULL,NULL,0,NULL,NULL,2,0,NULL,NULL,NULL),(95,'测试文章',1,'2020-05-20 18:00:09',1,'2020-05-20 20:47:15',6,'<p><br></p><hr><p><br></p><pre>&lt;html&gt; \r\n&lt;head&gt;  &lt;script type=&quot;text/javascript&quot; src=&quot;loadxmldoc.js&quot;&gt; &lt;/script&gt; &lt;/head&gt; \r\n&lt;body&gt;   &lt;script type=&quot;text/javascript&quot;&gt;    xmlDoc=<a href=\"https://www.w3school.com.cn/xmldom/dom_loadxmldoc.asp\">loadXMLDoc</a>(&quot;books.xml&quot;);    document.write(&quot;xmlDoc is loaded, ready for use&quot;);  &lt;/script&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre><p><span class=\"fr-emoticon fr-deletable fr-emoticon-img\" style=\"background: url(https://cdnjs.cloudflare.com/ajax/libs/emojione/2.0.1/assets/svg/1f62f.svg);\">&nbsp;</span> <span class=\"fr-emoticon fr-deletable fr-emoticon-img\" style=\"background: url(https://cdnjs.cloudflare.com/ajax/libs/emojione/2.0.1/assets/svg/1f621.svg);\">&nbsp;</span></p><h2><strong>The three greatest things you learn from traveling</strong></h2><p>Like all the great things on earth traveling teaches us by example. Here are some of the most precious lessons I&rsquo;ve learned over the years of traveling.</p><h3 style=\"text-align: left;\">Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it&rsquo;s also nice to learn about cultures online or from books, nothing comes close to experiencing <a class=\"fr-green\" href=\"https://en.wikipedia.org/wiki/Cultural_diversity\"><span style=\"color: rgb(209, 72, 65);\">cultural\r\ndiversity</span></a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be quite terrifying. While change and uncertainty makes us scared, traveling teaches us how ridiculous it is to be afraid of something before it happens. The moment you face your fear and see there was nothing to be afraid of, is the moment you discover bliss.</p><p><br></p>',NULL,0,'','&nbsp;&nbsp;ThethreegreatestthingsyoulearnfromtravelingLikeallthegreatthingsonearthtravelingteachesusbyexample.HerearesomeofthemostpreciouslessonsI&rsquo;velear',2,1,'测试文章','','1589968380259'),(96,'测试文章2',1,'2020-05-21 10:50:53',1,'2020-05-21 11:15:08',1,'<h1>textarea</h1><p>&nbsp;</p><blockquote><p>基础库 1.0.0 开始支持，低版本需做<a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">兼容处理</a>。</p></blockquote><p>&nbsp;</p><p>多行输入框。该组件是<a href=\"https://developers.weixin.qq.com/miniprogram/dev/component/native-component.html\">原生组件</a>，使用时请注意相关限制。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><table><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th style=\"width: 2.7997%;\">必填</th><th style=\"width: 60.7297%;\">说明</th><th>最低版本</th></tr></thead><tbody><tr><td>value</td><td>string</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">输入框的内容</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>placeholder</td><td>string</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">输入框为空时占位符</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>placeholder-style</td><td>string</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">指定 placeholder 的样式，目前仅支持color,font-size和font-weight</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>placeholder-class</td><td>string</td><td>textarea-placeholder</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">指定 placeholder 的样式类</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>disabled</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">是否禁用</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>maxlength</td><td>number</td><td>140</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">最大输入长度，设置为 -1 的时候不限制最大长度</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>auto-focus</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">自动聚焦，拉起键盘。</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>focus</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">获取焦点</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>auto-height</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">是否自动增高，设置auto-height时，style.height不生效</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>fixed</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">如果 textarea 是在一个 <code>position:fixed</code> 的区域，需要显示指定属性 fixed 为 true</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>cursor-spacing</td><td>number</td><td>0</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">指定光标与键盘的距离。取<code>textarea</code>距离底部的距离和<code>cursor-spacing</code>指定的距离的最小值作为光标与键盘的距离</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>cursor</td><td>number</td><td>-1</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">指定focus时的光标位置</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.5.0</a></td></tr><tr><td>show-confirm-bar</td><td>boolean</td><td>true</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">是否显示键盘上方带有&rdquo;完成&ldquo;按钮那一栏</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.6.0</a></td></tr><tr><td>selection-start</td><td>number</td><td>-1</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">光标起始位置，自动聚集时有效，需与<code>selection-end</code>搭配使用</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.9.0</a></td></tr><tr><td>selection-end</td><td>number</td><td>-1</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">光标结束位置，自动聚集时有效，需与<code>selection-start</code>搭配使用</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.9.0</a></td></tr><tr><td>adjust-position</td><td>boolean</td><td>true</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">键盘弹起时，是否自动上推页面</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.9.90</a></td></tr><tr><td>hold-keyboard</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">focus时，点击页面的时候不收起键盘</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">2.8.2</a></td></tr><tr><td>disable-default-padding</td><td>boolean</td><td>false</td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">是否去掉 iOS 下的默认内边距</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">2.10.0</a></td></tr><tr><td>bindfocus</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">输入框聚焦时触发，event.detail = { value, height }，height 为键盘高度，在基础库 1.9.90 起支持</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>bindblur</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">输入框失去焦点时触发，event.detail = {value, cursor}</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>bindlinechange</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">输入框行数变化时调用，event.detail = {height: 0, heightRpx: 0, lineCount: 0}</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>bindinput</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">当键盘输入时，触发 input 事件，event.detail = {value, cursor, keyCode}，keyCode 为键值，目前工具还不支持返回keyCode参数。<strong>bindinput 处理函数的返回值并不会反映到 textarea 上</strong></td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>bindconfirm</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">点击完成时， 触发 confirm 事件，event.detail = {value: value}</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">1.0.0</a></td></tr><tr><td>bindkeyboardheightchange</td><td>eventhandle</td><td><br></td><td style=\"width: 2.7997%;\">否</td><td style=\"width: 60.7297%;\">键盘高度发生变化的时候触发此事件，event.detail = {height: height, duration: duration}</td><td><a href=\"https://developers.weixin.qq.com/miniprogram/dev/framework/compatibility.html\">2.7.0</a></td></tr></tbody></table><h2><a href=\"https://developers.weixin.qq.com/miniprogram/dev/component/textarea.html#Bug-Tip\"></a> Bug &amp; Tip</h2><p>&nbsp;</p><ol><li><code>tip</code>: <code>textarea</code> 的 <code>blur</code> 事件会晚于页面上的 <code>tap</code> 事件，如果需要在 <code>button</code> 的点击事件获取 <code>textarea</code>，可以使用 <code>form</code> 的 <code>bindsubmit</code>。</li><li>&nbsp;</li><li><code>tip</code>: 不建议在多行文本上对用户的输入进行修改，所以 <code>textarea</code> 的 <code>bindinput</code> 处理函数并不会将返回值反映到 <code>textarea</code> 上。</li><li>&nbsp;</li><li><code>tip</code> : 键盘高度发生变化，keyboardheightchange事件可能会多次触发，开发者对于相同的height值应该忽略掉</li><li>&nbsp;</li><li><code>bug</code>: 微信版本 <code>6.3.30</code>，<code>textarea</code> 在列表渲染时，新增加的 <code>textarea</code> 在自动聚焦时的位置计算错误。</li></ol><p>&nbsp;</p><h2><a href=\"https://developers.weixin.qq.com/miniprogram/dev/component/textarea.html#示例代码\"></a> 示例代码</h2><p>&nbsp;</p><p><a href=\"https://developers.weixin.qq.com/s/QAwRn6m86tYu\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"在开发者工具中预览效果\">在开发者工具中预览效果</a></p><p>&nbsp;</p><pre><code>&lt;view class=&quot;section&quot;&gt;  &lt;textarea bindblur=&quot;bindTextAreaBlur&quot; auto-height placeholder=&quot;自动变高&quot; /&gt;\r\n&lt;/view&gt;\r\n&lt;view class=&quot;section&quot;&gt;  &lt;textarea placeholder=&quot;placeholder颜色是红色的&quot; placeholder-style=&quot;color:red;&quot;  /&gt;\r\n&lt;/view&gt;\r\n&lt;view class=&quot;section&quot;&gt;  &lt;textarea placeholder=&quot;这是一个可以自动聚焦的textarea&quot; auto-focus /&gt;\r\n&lt;/view&gt;\r\n&lt;view class=&quot;section&quot;&gt;  &lt;textarea placeholder=&quot;这个只有在按钮点击的时候才聚焦&quot; focus=&quot;{{focus}}&quot; /&gt;  &lt;view class=&quot;btn-area&quot;&gt;    &lt;button bindtap=&quot;bindButtonTap&quot;&gt;使得输入框获取焦点&lt;/button&gt;  &lt;/view&gt;\r\n&lt;/view&gt;\r\n&lt;view class=&quot;section&quot;&gt;  &lt;form bindsubmit=&quot;bindFormSubmit&quot;&gt;    &lt;textarea placeholder=&quot;form 中的 textarea&quot; name=&quot;textarea&quot;/&gt;    &lt;button form-type=&quot;submit&quot;&gt; 提交 &lt;/button&gt;  &lt;/form&gt;\r\n&lt;/view&gt;\r\n</code></pre><pre><code>//textarea.js\r\nPage({  data: {    height: 20,    focus: false  },  bindButtonTap: function() {    this.setData({      focus: true    })  },  bindTextAreaBlur: function(e) {    console.log(e.detail.value)  },  bindFormSubmit: function(e) {    console.log(e.detail.value.textarea)  }\r\n})\r\n<img src=\"http://localhost/admin/oss/download/upload/2020/5/5555200203210814_68661be9dc454ed09657236327378941.jpg\" style=\"width: 125px;\" class=\"fr-fic fr-dib\" data-msg=\"上传成功\" data-uploaded=\"true\"></code></pre>',NULL,0,'\'http://localhost/admin/oss/download/upload/2020/5/5555200203210814_68661be9dc454ed09657236327378941.jpg\'','textarea&nbsp;基础库1.0.0开始支持，低版本需做兼容处理。&nbsp;多行输入框。该组件是原生组件，使用时请注意相关限制。',2,1,'微信,小程序','','1590029238623'),(97,'和法规和官方1',1,'2020-05-28 14:06:44',1,'2020-05-29 00:43:12',8,'<h2><img src=\"http://image.bobey.site//upload/2020/5/single-blog_2219a790b24b4eb9a66c59e1d8d1f31a.jpg\" style=\"width: 745px;\" class=\"fr-fic fr-dib\" data-uploaded=\"true\" data-msg=\"上传成功\">The three greatest things you learn from traveling</h2><p>Like all the great things on earth traveling teaches us by\r\nexample. Here are some of the most precious lessons I&rsquo;ve learned\r\nover the years of traveling.</p><h3>Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it&rsquo;s also nice to learn about cultures online or from books, nothing comes close to experiencing <a href=\"https://en.wikipedia.org/wiki/Cultural_diversity\">cultural\r\ndiversity</a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be quite terrifying. While change\r\nand uncertainty makes us scared, traveling teaches us how\r\nridiculous it is to be afraid of something before it happens.\r\nThe moment you face your fear and see there was nothing to be\r\nafraid of, is the moment you discover bliss.</p>',NULL,0,'\'http://image.bobey.site//upload/2020/5/single-blog_2219a790b24b4eb9a66c59e1d8d1f31a.jpg\'','ThethreegreatestthingsyoulearnfromtravelingLikeallthegreatthingsonearthtravelingteachesusby\r\nexample.HerearesomeofthemostpreciouslessonsI&rsquo;velearned\r\noverthe',2,1,'吧v不能,nvn','','1590645965518');
